import React, { useState, useEffect } from 'react';
import ApiService from '../../services/api';

const SubscriptionManagement = () => {
  const [activeTab, setActiveTab] = useState('overview');
  const [selectedFilter, setSelectedFilter] = useState('all');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  
  // Modal states
  const [showCreateModal, setShowCreateModal] = useState(false);
  const [showEditModal, setShowEditModal] = useState(false);
  const [showFeaturesModal, setShowFeaturesModal] = useState(false);
  const [selectedPlan, setSelectedPlan] = useState(null);
  
  // Form states
  const [planForm, setPlanForm] = useState({
    name: '',
    slug: '',
    description: '',
    monthly_price: '',
    yearly_price: '',
    setup_fee: '',
    max_properties: '',
    max_images_per_property: '',
    analytics_enabled: false,
    priority_support: false,
    api_access: false,
    custom_branding: false,
    advanced_reporting: false,
    is_active: true,
    is_featured: false,
    sort_order: 0,
    trial_days: 0
  });

  // Load subscription plans and data
  useEffect(() => {
    fetchSubscriptionPlans();
    fetchSubscriptionStats();
  }, []);

  const fetchSubscriptionPlans = async () => {
    try {
      setLoading(true);
      const response = await ApiService.get('/admin/subscription-plans');
      setSubscriptionPlans(response.data || []);
    } catch (error) {
      console.error('Error fetching subscription plans:', error);
      setError('Failed to load subscription plans');
    } finally {
      setLoading(false);
    }
  };

  const fetchSubscriptionStats = async () => {
    try {
      const response = await ApiService.get('/admin/subscription-stats');
      const stats = response.data || {};
      setSubscriptionStats([
        { title: 'Total Subscribers', value: String(stats.total_subscribers || 0), change: '+0%', icon: 'ðŸ‘¥', color: 'text-black' },
        { title: 'Active Subscriptions', value: String(stats.active_subscriptions || 0), change: '+0%', icon: 'âœ…', color: 'text-black' },
        { title: 'Monthly Revenue', value: `â‚±${(stats.monthly_revenue || 0).toLocaleString()}`, change: '+0%', icon: 'ðŸ’°', color: 'text-black' },
        { title: 'Pending Renewals', value: String(stats.pending_renewals || 0), change: '+0%', icon: 'â°', color: 'text-black' }
      ]);
    } catch (error) {
      console.error('Error fetching subscription stats:', error);
    }
  };

  const [subscriptionPlans, setSubscriptionPlans] = useState([]);
  const [subscriptionStats, setSubscriptionStats] = useState([
    { title: 'Total Subscribers', value: '0', change: '0%', icon: 'ðŸ‘¥', color: 'text-black' },
    { title: 'Active Subscriptions', value: '0', change: '0%', icon: 'âœ…', color: 'text-black' },
    { title: 'Monthly Revenue', value: 'â‚±0', change: '0%', icon: 'ðŸ’°', color: 'text-black' },
    { title: 'Pending Renewals', value: '0', change: '0%', icon: 'â°', color: 'text-black' }
  ]);

  const [subscribers, setSubscribers] = useState([]);

  // Form handlers
  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setPlanForm(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const resetForm = () => {
    setPlanForm({
      name: '',
      slug: '',
      description: '',
      monthly_price: '',
      yearly_price: '',
      setup_fee: '',
      max_properties: '',
      max_images_per_property: '',
      analytics_enabled: false,
      priority_support: false,
      api_access: false,
      custom_branding: false,
      advanced_reporting: false,
      is_active: true,
      is_featured: false,
      sort_order: 0,
      trial_days: 0
    });
    setSelectedPlan(null);
    setError('');
    setSuccess('');
  };

  // CRUD Operations
  const handleCreatePlan = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);
      setError('');
      
      const response = await ApiService.post('/admin/subscription-plans', planForm);
      
      if (response.success) {
        setSuccess('Subscription plan created successfully!');
        setShowCreateModal(false);
        resetForm();
        fetchSubscriptionPlans();
        fetchSubscriptionStats();
      }
    } catch (error) {
      setError(error.response?.data?.message || 'Failed to create subscription plan');
    } finally {
      setLoading(false);
    }
  };

  const handleEditPlan = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);
      setError('');
      
      const response = await ApiService.put(`/admin/subscription-plans/${selectedPlan.id}`, planForm);
      
      if (response.success) {
        setSuccess('Subscription plan updated successfully!');
        setShowEditModal(false);
        resetForm();
        fetchSubscriptionPlans();
        fetchSubscriptionStats();
      }
    } catch (error) {
      setError(error.response?.data?.message || 'Failed to update subscription plan');
    } finally {
      setLoading(false);
    }
  };

  const handleDeletePlan = async (planId) => {
    if (!window.confirm('Are you sure you want to delete this subscription plan?')) {
      return;
    }
    
    try {
      setLoading(true);
      const response = await ApiService.delete(`/admin/subscription-plans/${planId}`);
      
      if (response.success) {
        setSuccess('Subscription plan deleted successfully!');
        fetchSubscriptionPlans();
        fetchSubscriptionStats();
      }
    } catch (error) {
      setError(error.response?.data?.message || 'Failed to delete subscription plan');
    } finally {
      setLoading(false);
    }
  };

  // Modal handlers
  const openCreateModal = () => {
    resetForm();
